import React from 'react';

function PageTitleButton({ onClick, color }) {
    return (
        <button
            onClick={onClick}
            style={{
                height: "30px",
                width: "30px",
                position: "absolute",
                left: "15px",
                cursor: "pointer",
                backgroundColor: white,
                border: "none", // Removes default button styles
                padding: 0, // Ensures size matches the image
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
            }}
            aria-label="Go back" // Screen reader description
        >
            <img
                src='./UI/UI_Arrow.svg'
                alt="" // Decorative images should have an empty alt attribute
                style={{ height: "100%" }}
            />
        </button>
    );
}

export default PageTitleButton;
